import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';

// Test Onboarding component in isolation
function TestOnboarding() {
  return (
    <div style={{ padding: '2rem', background: '#f5f1ec', minHeight: '100vh' }}>
      <h1>Onboarding Test</h1>
      <p>If you see this, React is working. Testing Onboarding component...</p>
      <div style={{ 
        background: '#fff', 
        padding: '2rem', 
        borderRadius: '8px', 
        marginTop: '1rem',
        border: '1px solid #ddd'
      }}>
        <h2>Simple Onboarding Simulation</h2>
        <p>Step 1: Choose a language</p>
        <button style={{ padding: '0.5rem 1rem', margin: '0.5rem' }}>Spanish</button>
        <button style={{ padding: '0.5rem 1rem', margin: '0.5rem' }}>Hindi</button>
        <button style={{ padding: '0.5rem 1rem', margin: '0.5rem' }}>Japanese</button>
      </div>
    </div>
  );
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <TestOnboarding />
  </React.StrictMode>
);
